text:
@regran_ed from @elizabethwarren -  when i decided to run for the senate in 2012, i never thought that my family’s native american heritage would come under attack and my dead parents would be called liars. and i never expected the president of the united states to use my family’s story as a racist political joke against native american history, culture, and people – over, and over, and over.

but you know me: i don’t take any fight lying down, so today we launched a new fact squad website for anyone who wants see the facts for themselves. 
elizabethwarren.com/heritage - #regrann

